import React from "react";
import "./Css/bottomnavbar.css";
import Instagram from "./Images/insta.png";
import tiktok from "./Images/tiktok.png";
import youtube from "./Images/youtube.png";
import { useNavigate } from "react-router-dom";
function Bottomnavbar() {
  const Navigate = useNavigate();


const socialLinks = {
  LocusMotivation: [
    {
      name: "Tiktok",
      img: tiktok,
      link: ["https://www.tiktok.com/@locusmotivation","https://www.tiktok.com/@learnreflectsmotivation","https://www.tiktok.com/@motivationreflect"]
    },
    {
      name: "Instagram",
      img: Instagram,
      link: ["https://www.instagram.com/learnreflects/","https://www.instagram.com/locusmotivation/","https://www.instagram.com/motivationreflects/",]
    },
    {
      name: "YouTube",
      img: youtube, 
      link: ["https://www.youtube.com/@MotivationLearnReflect","https://www.youtube.com/@LearnReflects","https://www.youtube.com/@LocusMotivation"]
    }
  ]

  
}
  
  return (
    <div>
      <p className="collab">collaboration Socials</p>
      <div className="BottomNavBar-Container">
        <div className="collaboration">
          <div>
            <ul>Locus Motivation</ul>
            <img  src={tiktok} alt="LocusImg1" />
            <img src={Instagram} alt="LocusImg2" />
            <img src={youtube} alt="LocusImg3" />
          </div>
          <div>
            <ul>LearnReflectSystem</ul>
            <img src={tiktok} alt="LocusImg1" />
            <img src={Instagram} alt="LocusImg2" />
            <img src={youtube} alt="LocusImg3" />
          </div>
          <div>
            <ul>MotivationReflect</ul>
            <img src={tiktok} alt="LocusImg1" />
            <img src={Instagram} alt="LocusImg2" />
            <img src={youtube} alt="LocusImg3" />
          </div>
        </div>
      </div>
    </div>
  );
}
export default Bottomnavbar;
